import React from "react";
import { Typography, Box, Container } from "@mui/material";
import AudioPlayer from "./AudioPlayer"; // Import the AudioPlayer component

function Home() {
  // Sample audio file URLs
  const audioFiles = [
    { url: "https://example.com/audio1.mp3", name: "Audio 1" },
    { url: "https://example.com/audio2.mp3", name: "Audio 2" },
    { url: "https://example.com/audio3.mp3", name: "Audio 3" },
  ];

  return (
    <Container sx={{ maxWidth: "100%", padding: "0" }}>
      <Box
        sx={{
          marginTop: "50px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
          flexDirection: "column", // Align content vertically
        }}
      >
        <Typography
          variant="h1"
          sx={{
            fontFamily: "Rubik",
            fontSize: "6rem",
            color: "lightblack",
            marginBottom: "20px", // Add margin below the heading
          }}
        >
          Welcome To SuperSonics
        </Typography>
        {/* Pass the audioFiles array to the AudioPlayer component */}
        <AudioPlayer audioFiles={audioFiles} />
      </Box>
      <Container sx={{ maxWidth: "100%", padding: "0" }}>
        {/* Your existing JSX */}
        <Footer />
      </Container>
    </Container>
  );
}

export default Home;
